style.css:
@-moz-document url-prefix("https://goodblox.xyz/catalog/item?id=") {
#CatalogContainer .Assets img, #ItemContainer #Thumbnail img {
   display: none!important;
}
#CatalogContainer .Assets img, #ItemContainer #Thumbnail {
   background-image: url("http://web.archive.org/web/20200509024130im_/https://goodblox.xyz/goodblox/images/render/model/4386.png?t1588989270")!important;
}
}

@-moz-document url("https://goodblox.xyz/catalog/"), url-prefix("https://goodblox.xyz/catalog/?Category=RecentlyUpdated"), url-prefix("https://goodblox.xyz/catalog/?Category=ForSale"), url-prefix("https://goodblox.xyz/catalog/?Category=BestSelling"), url-prefix("https://goodblox.xyz/catalog/?Category=TopFavorites"), url-prefix("https://goodblox.xyz/my/home/"), url-prefix("https://goodblox.xyz/users/?id="), url-prefix("https://goodblox.xyz/my/character/") {
#CatalogContainer .Assets img, #ItemContainer #Thumbnail img, #UserContainer .Asset .AssetThumbnail img, .imgc img {
   display: none!important;
}
#CatalogContainer .Asset .AssetThumbnail, #UserContainer .Asset .AssetThumbnail, .imgc {
   background-image: url("https://cdn.discordapp.com/attachments/575458375211679756/728876194744893480/sock_small.png")!important;
}
}
